import Main from '../Components/Main';
import { Grid } from '@mui/material';

const Admin = () => {
  return (
    <>
      <h1>This is admins</h1>
      <Grid className="admin-main-container" container spacing={1}>
        <Grid className="admin-side-bar" item sm={2} sx={{ height: "100%" }}>
          <Sidebar />
        </Grid>
